{{info}}
* These instructions assume you're using XWiki 1.2 or later with the **[[Albatross, Toucan or Colibri skins>>AdminGuide.Skins]]** (screenshots for Colibri).
* The default skin is currently Colibri.
{{/info}}

= Adding users to your wiki =

1. Log in as an administrator
1. Hover over "Wiki" and click on "Administer Wiki"
1. Click on the "Users" link to bring up an overview of all the users
1. Click on the "Add new user" button to open a registration page as shown on the image below
1. Fill in the user information 
1. Click "Save":(((
{{image reference="AdminGuide.User Management@AddUser.png"/}}
)))

= Changing a user's password =

== Changing the password for any user ==

1. Log in as an administrator
1. Hover over "Wiki" and click on "Administer Wiki"
1. Click on the "Users" link to bring up an overview of all the users
1. Click on the name of the user for which you want to change the password (this will take you to the user's profile page)
1. Click on the "Preferences" tab
1. Click on the "Change Password" button
1. Enter the new password twice
1. Click on the "Update" button(((
{{image reference="AdminGuide.User Management@ChangePassword.png"/}}

{{warning}}
Don't forget to notify the user!
{{/warning}}
)))

== Changing the password for the logged in user ==

To change **your own password** follow these steps:

1. Click on your user name in the top right corner of the screen (this will redirect you to your profile) 
1. Click on the "Preferences" tab 
1. Click on the "Change password" button
1. Enter the new password twice
1. Click on the "Update" button(((
{{image reference="AdminGuide.User Management@ChangePassword.png"/}}
)))

= Editing an existing user =

1. Log in as an administrator
1. Hover over "Wiki" and click on "Administer Wiki"
1. Click on the "Users" link to bring up an overview of all the users
1. You have two options: 
11. Click the user name for the user you want to edit
11*. On the user's profile page click on the small yellow pencil corresponding to the information you want to edit (profile or preferences)
11*. Click "Save and View" to save the changes you have made
11. Click on the small yellow pencil near the user you want to edit (this will open up a lightbox with the main information of that user)
11*. Make your modifications and click "Save"(((
{{info}}
There is also a link to the complete user profile, where you can proceed as above (first option).
{{/info}}

{{image reference="AdminGuide.User Management@EditUserProfile.png"/}}
)))

= Deleting a user =

1. Log in as an administrator
1. Hover over "Wiki" and click on "Administer Wiki"
1. Click on the "Users" link to bring up an overview of all the users
1. Delete the user by clicking the red "X" corresponding to the user you want to delete (the user will be automatically removed from all the groups it belonged to)(((
{{info}}
You won't be able to delete the currently logged in user and you'll need to log-in using other credentials. This is don in order to prevent mistakes.
{{/info}}

{{image reference="AdminGuide.User Management@DeleteUser.png"/}}
)))

= Modify the number of users displayed in the list =

This is valid as of v3.5 (I think it works on any 3.x version).

You have to edit ##XWiki.AdminUsersSheet## for users. The page contains a line like this:

{{code}}
var ta = new XWiki.widgets.LiveTable("$url", "userstable", callback);
{{/code}}

Replace it with:

{{code}}
var ta = new XWiki.widgets.LiveTable("$url", "userstable", callback, {limit: 100});
{{/code}}

where 100 is the number of items displayed per page.

= Customizing the Registration page =

{{info}}
Since [[XWiki Exterprise 2.2M2>>xwiki:ReleaseNotes.ReleaseNotesXWikiEnterprise22M2#HNewRegistrationpage]] customizing the registration page is done by the "Verified Registration" Page, part of the [[Administration Application>>extensions:Extension.Administration Application]]. This provides more features such as captcha and client side validation of user input. For more information about how to configure it, visit the [[application page>>extensions:Extension.Administration Application]].
{{/info}}

In order to customize the registration page you must follow these steps:

1. Log in as an administrator
1. Hover over "Wiki" and click on "Administer Wiki"
1. Click on the "Registration" link
1. Make your modifications and click "Save":(((
{{image reference="AdminGuide.User Management@Registration.png"/}}
)))

{{error}}
Be sure to fill in admin's e-mail in Administration -> Configuration -> Email. Otherwise XWiki prior 4.5 won't send verification e-mails while E-mail verification is on.
{{/error}}
